Описание:
Масло-блеск Lip Comfort Oil от Clarins – инновационный продукт для красоты губ и ежедневного ухода. Формула на основе натуральных масел увлажняет, питает и спасает от обезвоженности. Средство разглаживает неровности и шелушения, создает равномерное покрытие с зеркальным сиянием и деликатным оттенком. Уникальная текстура Lip Comfort Oil не оставляет ощущения липкости и легко распределяется за счет удобного спонж-аппликатора. Оттенки масла-блеска, которые имеют дополнительное действие:

01 honey – питание;
04 candy и 05 tangerine – более яркие оттенки;
06 mint – увеличение объема.

Состав:
AQUA / WATER / EAU; CLYCERIN; SQUALANE; DIMETHICONE; PANTHENOL; ZEA MAYS STARCH / CORN STARCH; NIACINAMIDE; AMMONIUM POLYACRYLOYLD METHYL TAURATE; MYRISTYL MYRISTATE;
BIXA ORELLANA SEED EXTRACT; STEARIC ACID; POTASSIUM CETYL; PHOSPHATE; GLYCERYL STEARATE SE;
SODIUM HYDROXIDE; MYRISTIC ACID; 2-OLEAMIDO-1,3-OCTADECANEDIOL; PALMITIC ACID; HYDROXYACETOPHENONE; CAPRYLOYL GLYCINE; CAPRYLYL GLYCOL; VITREOSCILLA FERMENT; CITRIC ACID; MALTODEXTRIN; XANTHAN GUM; PARFUM / FRAGRANCE. (CODE F.I.L.: N282852/1)

Описание:
Гидрофильное гель-масло для умывания — идеальное средство для бережного, но эффективного очищения и снятия макияжа. Оно не оставляет жирного блеска и ощущения липкости. Входящие в состав средства драгоценные масла интенсивно увлажняют, смягчают, устраняют шелушение, делают кожу гладкой и бархатистой. При контакте с водой гель-масло превращается в нежнейшее молочко.

<p>Как работает:
<p>масло манго устраняет шелушение, нормализует гидролипидный баланс, сохраняет естественную увлажнённость кожи;
<p>масло авокадо смягчает кожу, стимулирует обменные процессы, восстанавливает барьерные функции эпидермиса;
<p>масло кокоса глубоко увлажняет, восстанавливает липидный барьер кожи, придаёт ей гладкость и бархатистость;
<p>экстракты манго, имбиря и арники тонизируют, обладают антиоксидантными свойствами и способствуют осветлению кожи.

<p>Результат:
<p>мягкое очищение кожи;
<p>быстрое снятие макияжа;
<p>интенсивное увлажнение;
<p>постепенное смягчение кожи;
<p>полное устранение шелушения;
<p>чистая, гладкая, ухоженная кожа.

<p>Для кого:
Для тех, кто хочет максимально мягкое, но эффективное средство, которое не только очищает, снимает макияж, но и бережно заботится о коже.<br><br>

Дизайн упаковки может отличаться от фото в интернет-магазине.

Гидролат розы – это цветочная вода, которая обладает приятным легким ароматом, она наделена практически всеми полезными качествами розы, широко востребованными в косметологии:
- заживляет раны, так как является замечательным природным антисептиком; 
- снимает воспаления;
питает и увлажняет, в результате чего кожа становится более упругой и эластичной;
- предотвращает появление первых признаков старения;
- укрепляет капилляры и нормализует обращение крови эпидермиса, поэтому подойдет для борьбы с куперозом и гиперемией;
- защищает, успокаивает и увлажняет нежную кожу вокруг глаз, помогает бороться с темными кругами;
- способствует росту волос, увлажняет и тонизирует кожу головы.
Несмотря на то, что гидролат подходит практически всем, им не стоит пользоваться во время беременности и при индивидуальной непереносимости.

Способ применения:
Можно использовать:
- для нанесения на кожу в чистом виде в качестве тоника;
- как наполнитель увлажняющих спреев для тела;
- для обогащения косметики (кремов, гелей для душа);
- в виде добавки в шампунь или бальзам для волос.
